import React from 'react';
import { StyledDisplay } from './styles/StyledDisplay';

const Display = ({ gameOver, text ,score}) => (
  <StyledDisplay gameOver={gameOver}>{`${text}+' '+Score:${score}`}</StyledDisplay>
)

export default Display;
